                Một số thông tin có thể hiển thị.
                </p>
              </div>
              <ul className="list-group list-group-flush">
                <li className="list-group-item"><b>Họ và tên:</b><a className="ml-10" style={{marginLeft: '150px'}}>Nguyễn Phạm Trúc Phương</a></li>
