                <a className="card-link">Card link</a>
                <a className="card-link">Another link</a>
              </div>
            </div>
          </div>
          <div className="col-md-8">
            <div className="card">
              <div className="card-body">
                <h4 className="card-title">Thông tin liên lạc</h4>
              </div>
              <ul className="list-group list-group-flush">
